-- ----------------------------
DROP TABLE IF EXISTS `client`;
CREATE TABLE `client`  (
  `client_id` bigint(255) NOT NULL AUTO_INCREMENT COMMENT '客户id',
  `parent_client_id` bigint(255) NOT NULL DEFAULT 0 COMMENT '介绍人（父id）',
  `user_id` bigint(255) NOT NULL COMMENT '用户id（创建这个客户的人）',
  `dept_id` bigint(255) NOT NULL COMMENT '部门id（创建这个客户的人所在的部门）',
  `shop_id` bigint(255) NOT NULL COMMENT '所属门店（也就是部门，添加此客户的人选择的）',
  `optometrist_id` bigint(255) NOT NULL DEFAULT 0 COMMENT '验光师id（也就是用户id）(废弃了)',
  `source_type` tinyint(255) NOT NULL COMMENT '客户来源（参数表里type为5的）',
  `client_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '客户名字',
  `client_sex` tinyint(5) NULL DEFAULT 1 COMMENT '客户性别（字典）',
  `client_phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '客户电话',
  `client_age` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '客户年龄',
  `passport_number` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '客户护照号',
  `province` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '省',
  `city` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '市',
  `district` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '区',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '详细地址',
  `intention_level` tinyint(5) NOT NULL DEFAULT 0 COMMENT '意向等级',
  `status` tinyint(5) NOT NULL DEFAULT 0 COMMENT '客户状态（0准会员1会员）\r\n准会员：未消费过\r\n会员：消费过',
  `integral` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '积分',
  `total_integral` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '总共获得积分',
  `member_level` tinyint(10) NOT NULL DEFAULT 0 COMMENT '会员等级（默认0，会员等级表里的数据）',
  `member_date` datetime(0) NULL DEFAULT NULL COMMENT '成为会员时间',
  `consumption_num` int(11) NOT NULL DEFAULT 0 COMMENT '消费次数',
  `remark` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '客户备注',
  `create_date` datetime(0) NOT NULL COMMENT '创建时间',
  `allocation_date` datetime(0) NULL DEFAULT NULL COMMENT '分配新话务员时间',
  `del_status` tinyint(5) NOT NULL DEFAULT 0 COMMENT '删除状态0未1已',
  `client_weixin` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '微信',
  PRIMARY KEY (`client_id`) USING BTREE,
  INDEX `client_member_date_index`(`member_date`) USING BTREE,
  INDEX `client_create_date_index`(`create_date`) USING BTREE,
  INDEX `client_client_phone_index`(`client_phone`) USING BTREE,
  INDEX `client_status_dept_index`(`del_status`, `status`, `dept_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '客户表' ROW_FORMAT = Dynamic;

